import React from "react";
import { Menu, theme } from "antd";
import {
  UserOutlined,
  VideoCameraOutlined,
  UploadOutlined,
} from "@ant-design/icons";

const { token } = theme.useToken();

const Sider = ({ collapsed }) => {
  return (
    <Sider
      breakpoint="lg"
      collapsedWidth="0"
      onBreakpoint={(broken) => {
        console.log(broken);
      }}
      onCollapse={(collapsed, type) => {
        console.log(collapsed, type);
      }}
      trigger={null}
      collapsible
      collapsed={collapsed}
    >
      <div className="demo-logo-vertical" />
      <Menu
        theme="dark"
        mode="inline"
        defaultSelectedKeys={["4"]}
        items={[
          { icon: <UserOutlined />, label: "nav 1" },
          { icon: <VideoCameraOutlined />, label: "nav 2" },
          { icon: <UploadOutlined />, label: "nav 3" },
          { icon: <UserOutlined />, label: "nav 4" },
        ]}
      />
    </Sider>
  );
};

export default Sider;
